this["Fliplet"]["Widget"]["Templates"]["templates.build.agenda-base"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"new-agenda-list-container loading{{#if hasTopBar}} has-top-bar{{/if}}{{#if showAddEntry}} has-add-entry{{/if}}\">\r\n  <!-- Filter Overlay -->\r\n  {{#if filtersInOverlay}}\r\n  <div class=\"new-agenda-search-filter-overlay\">\r\n    <div class=\"agenda-overlay-screen\"></div>\r\n    <div class=\"agenda-overlay-wrapper\">\r\n      <div class=\"agenda-overlay-header\">\r\n        <div class=\"agenda-overlay-close focus-outline\" tabindex=\"0\">\r\n          <i class=\"fa fa-angle-left\"></i>\r\n        </div>\r\n        <div class=\"filter-header-holder\">\r\n          <div class=\"filter-header-btn-controls\">\r\n            <div class=\"btn clear-filters hidden focus-outline\" tabindex=\"0\">Clear</div>\r\n            <div class=\"btn apply-filters focus-outline\" tabindex=\"0\">Apply</div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"agenda-overlay-content\">\r\n        <div class=\"hidden-filter-controls\">\r\n          <div class=\"hidden-filter-controls-content\">\r\n            <div class=\"filters-header\">Filter by</div>\r\n            <div class=\"filter-holder\">\r\n              <!-- Filters here -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  {{/if}}\r\n  <!-- End of Filter Overlay -->\r\n\r\n  <!-- Top bar with profile and search icons -->\r\n  <div class=\"section-top-wrapper\">\r\n    {{#if searchEnabled}}\r\n    <div class=\"search-holder\">\r\n      <i class=\"fa fa-search\"></i>\r\n      <input type=\"search\" name=\"search-feed\" class=\"form-control search-feed focus-outline\" tabindex=\"0\" placeholder=\"Search...\" required >\r\n      <div class=\"btn btn-default search-btn\">Search</div>\r\n      <div class=\"btn btn-default search-btn searching-btn\"><i class=\"fa fa-spinner fa-pulse fa-fw\"></i></div>\r\n    </div>\r\n    {{/if}}\r\n    {{#ifCond filtersEnabled '||' bookmarksEnabled}}\r\n    <div class=\"list-search-icon\">\r\n      {{#ifCond bookmarksEnabled '&&' hasTopBar}}\r\n      <div class=\"toggle-bookmarks focus-outline\" tabindex=\"0\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\" >\r\n        <span class=\"fa fa-bookmark-o\"></span>\r\n        <span class=\"fa fa-bookmark\"></span>\r\n      </div>\r\n      {{/ifCond}}\r\n      <div class=\"list-search-cancel focus-outline\" tabindex=\"0\" ><span class=\"fa fa-times\"></span></div>\r\n      {{#if filtersEnabled}}\r\n      <i class=\"fa fa-sliders focus-outline\" tabindex=\"0\"></i>\r\n      {{/if}}\r\n    </div>\r\n    {{/ifCond}}\r\n  </div>\r\n  <!-- End of Top bar -->\r\n\r\n  {{#if bookmarksEnabled}}\r\n    {{#unless hasTopBar}}\r\n    <div class=\"agenda-list-controls focus-outline\" tabindex=\"1\">\r\n      <div class=\"toggle-agenda\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\">\r\n        <span class=\"fa fa-bookmark-o\"></span>\r\n        <span class=\"fa fa-bookmark\"></span>\r\n        <div class=\"agenda-list-label\">My Agenda</div>\r\n      </div>\r\n    </div>\r\n    {{/unless}}\r\n  {{/if}}\r\n\r\n  <!-- Days slider -->\r\n  <div class=\"agenda-date-selector\">\r\n    <ul>\r\n      <!-- Day filter will be added here -->\r\n    </ul>\r\n  </div>\r\n\r\n  <!-- Agenda Cards -->\r\n  <div class=\"agenda-cards-wrapper\" id=\"agenda-cards-wrapper-{{id}}\">\r\n    <div class=\"agenda-list-holder\" role=\"list\">\r\n      <!-- Cards will be rendered here -->\r\n    </div>\r\n    <!-- States messages -->\r\n    <div class=\"agenda-state-messages\">\r\n      <div class=\"loading-holder\">\r\n        <i class=\"fa fa-circle-o-notch fa-spin\"></i> Loading agenda...\r\n      </div>\r\n    </div>\r\n  </div>\r\n\r\n  <!-- Search results -->\r\n  <div class=\"search-results-wrapper\">\r\n    <!-- Inline Search and Filters -->\r\n    <div class=\"hidden-controls\">\r\n      {{#if searchEnabled}}\r\n      <div class=\"hidden-search-controls\">\r\n        <div class=\"hidden-search-controls-content\">\r\n          <div class=\"hidden-filter-controls-search\">\r\n            <div class=\"search-query-holder\">\r\n              <div class=\"search-query\">\r\n              Searching for <span class=\"current-query-wrapper\"><span class=\"current-query\"></span><span class=\"clear-search focus-outline\" tabindex=\"0\"><i class=\"fa fa-times\"></i></span></span>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      {{/if}}\r\n      <div class=\"active-filters hidden\">\r\n        <div class=\"hidden-filter-controls-label\">Filters applied</div>\r\n        <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\r\n          <div class=\"hidden-filter-controls-filter-wrapper\">\r\n            <fieldset data-filter-active-group>\r\n            </fieldset>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      {{#if filtersEnabled}}\r\n      <div class=\"hidden-filter-controls\">\r\n        <div class=\"hidden-filter-controls-content\">\r\n          {{#unless filtersInOverlay}}\r\n            {{#if filtersEnabled}}\r\n            <div class=\"filter-holder inline-filter-holder\">\r\n              <!-- Filters here -->\r\n            </div>\r\n            {{/if}}\r\n          {{/unless}}\r\n        </div>\r\n      </div>\r\n      {{/if}}\r\n    </div>\r\n    <!-- End of Inline Search and Filters -->\r\n    <div class=\"search-results-holder\"></div>\r\n  </div>\r\n</div>\r\n\r\n<!-- Detail view overlay -->\r\n<div class=\"agenda-detail-overlay\" id=\"agenda-detail-overlay-{{id}}\">\r\n  <div class=\"agenda-detail-overlay-wrapper\">\r\n    <div class=\"agenda-detail-overlay-panel\">\r\n      <div class=\"agenda-detail-overlay-close focus-outline {{#if previousScreen}}go-previous-screen{{/if}}\" tabindex=\"0\">\r\n        <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\r\n      </div>\r\n      <div class=\"agenda-detail-overlay-content\">\r\n        <div class=\"agenda-detail-overlay-content-holder\">\r\n          <!-- Details will be added here -->\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"agenda-detail-overlay-close tablet {{#if previousScreen}}go-previous-screen{{/if}}\" >\r\n      <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\r\n    </div>\r\n  </div>\r\n  <div class=\"agenda-detail-overlay-screen {{#if previousScreen}}go-previous-screen{{/if}}\"></div>\r\n</div>\r\n\r\n{{#if showAddEntry}}\r\n<div class=\"dynamic-list-add-item focus-outline\" tabindex=\"1\">\r\n  <i class=\"fa fa-plus\"></i>\r\n</div>\r\n{{/if}}\r\n";
},"useData":true});

this["Fliplet"]["Widget"]["Templates"]["templates.build.agenda-cards-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"agenda-item-inner-content clearfix\" data-entry-id=\"{{id}}\">\r\n  <div class=\"agenda-item-content-holder\">\r\n    {{#if [Title]}}\r\n    <h2 class=\"agenda-item-title\">{{[Title]}}</h2>\r\n    {{/if}}\r\n    <div class=\"agenda-item-session-location\">\r\n      {{#if [Location]}}\r\n      <p class=\"agenda-item-location\">{{{[Location]}}}</p>\r\n      {{/if}}\r\n      <p class=\"agenda-item-start-date-time\">{{[Start Time]}}{{#ifCond [Start Time] '&&' [End Time]}} - {{/ifCond}}{{[End Time]}}{{#if [Full Date]}} / {{/if}}{{formatDate [Full Date]}}</p>\r\n    </div>\r\n\r\n    <div class=\"agenda-item-bookmark {{#if agendaButtonsEnabled}}more-buttons{{/if}}\">\r\n      <div class=\"agenda-item-bookmark-holder agenda-item-bookmark-holder-{{id}}\">\r\n        <div class=\"bookmark-wrapper focus-outline btn-bookmark\" tabindex=\"0\">\r\n          <i class=\"fa fa-bookmark-o\"></i>Bookmark\r\n        </div>\r\n        <div class=\"bookmark-wrapper focus-outline btn-bookmarked\" tabindex=\"0\">\r\n          <i class=\"fa fa-bookmark\"></i>Bookmarked\r\n        </div>\r\n\r\n        <div class=\"agenda-item-add-agenda\"></div>\r\n      </div>\r\n      {{#if pollButton}}\r\n      <div class=\"go-to-poll session-button focus-outline\" tabindex=\"0\">\r\n        <i class=\"fa fa-pie-chart\"></i>Poll\r\n      </div>\r\n      {{/if}}\r\n      {{#if surveyButton}}\r\n      <div class=\"go-to-survey session-button focus-outline\" tabindex=\"0\">\r\n        <i class=\"fa fa-pencil-square-o\"></i>Survey\r\n      </div>\r\n      {{/if}}\r\n      {{#if questionsButton}}\r\n      <div class=\"go-to-questions session-button focus-outline\" tabindex=\"0\">\r\n        <i class=\"fa fa-question-circle-o\"></i>Questions\r\n      </div>\r\n      {{/if}}\r\n    </div>\r\n\r\n    <div class=\"agenda-item-description\">\r\n      {{#each entryDetails}}\r\n        <!-- Image template -->\r\n        {{#ifCond type '==' 'image'}}\r\n          {{#if content}}\r\n            <div data-detail-entry-id=\"{{id}}\">\r\n              {{#if labelEnabled}}\r\n                <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n              {{/if}}\r\n              {{#if (isSingle contentArray)}}\r\n                <div class=\"agenda-item-detail-body-text single-image-holder\">\r\n                  <img src=\"{{validateImage content}}\">\r\n                </div>\r\n              {{else}}\r\n                <div class=\"multiple-images-holder\" >\r\n                  {{#each contentArray}}\r\n                    <div class=\"multiple-images-item\">\r\n                      <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\r\n                    </div>\r\n                  {{/each}}\r\n                </div>\r\n              {{/if}}\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Plain text template -->\r\n        {{#ifCond type '==' 'text'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">{{content}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- HTML template -->\r\n        {{#ifCond type '==' 'html'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">{{{auth content}}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- URL template -->\r\n        {{#ifCond type '==' 'url'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">\r\n              <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Telephone template -->\r\n        {{#ifCond type '==' 'tel'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">\r\n              <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Email template -->\r\n        {{#ifCond type '==' 'mail'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">\r\n              <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Date template -->\r\n        {{#ifCond type '==' 'date'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"agenda-item-detail-body-text\">{{formatDate content}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- File template -->\r\n        {{#ifCond type '==' 'file'}}\r\n          {{#if content}}\r\n            <ul class=\"file-holder\">\r\n              {{#if labelEnabled}}\r\n                <div class=\"agenda-item-detail-label\">{{label}}</div>\r\n              {{/if}}\r\n              {{#each content}}\r\n                <li class=\"file-item\">\r\n                  <div class=\"file-title\">{{this.name}}</div>\r\n                  <div class=\"file-info\">\r\n                    <span class=\"file-info-uploaded\">Uploaded: {{formatDate this.uploaded}}</span>\r\n                    {{#if this.size}}<span class=\"file-info-size\">&ndash; {{humanFileSize this.size}}</span>{{/if}}\r\n                  </div>\r\n                  <input type=\"hidden\" value={{this.url}}>\r\n                  <div class=\"file-icon\">\r\n                    <i class=\"fa fa-angle-right\"></i>\r\n                  </div>\r\n                </li>\r\n              {{/each}}\r\n            </ul>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n      {{/each}}\r\n    </div>\r\n\r\n    {{#ifCond editEntry '||' deleteEntry}}\r\n    <div class=\"dynamic-list-controls\">\r\n      {{#if editEntry}}\r\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">Edit</div>\r\n      {{/if}}\r\n      {{#if deleteEntry}}\r\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">Delete</div>\r\n      {{/if}}\r\n    </div>\r\n    {{/ifCond}}\r\n  </div>\r\n</div>";
},"useData":true});

