    return "<div class=\"new-news-feed-list-container loading\">\r\n  <!-- Filter Overlay -->\r\n  {{#if filtersInOverlay}}\r\n  <div class=\"news-feed-search-filter-overlay\">\r\n    <div class=\"news-feed-overlay-screen\"></div>\r\n    <div class=\"news-feed-overlay-wrapper\">\r\n      <div class=\"news-feed-overlay-header\">\r\n        <div class=\"news-feed-overlay-close focus-outline\" tabindex=\"0\">\r\n          <i class=\"fa fa-angle-left\"></i>\r\n        </div>\r\n        <div class=\"filter-header-holder\">\r\n          <div class=\"filter-header-btn-controls\">\r\n            <div class=\"btn clear-filters hidden focus-outline\" tabindex=\"0\">Clear</div>\r\n            <div class=\"btn apply-filters focus-outline\" tabindex=\"0\">Apply</div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n      <div class=\"news-feed-overlay-content\">\r\n        <div class=\"hidden-filter-controls\">\r\n          <div class=\"hidden-filter-controls-content\">\r\n            <div class=\"filters-header\">Filter by</div>\r\n            <div class=\"filter-holder\">\r\n              <!-- Filters here -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  {{/if}}\r\n  <!-- End of Filter Overlay -->\r\n\r\n  <!-- Developer back button -->\r\n  <div class=\"back-button-holder {{#unless goBackButton}}hidden{{/unless}}\">\r\n    <div class=\"btn news-feed-back-button\" data-lfd-back>Go back</div>\r\n  </div>\r\n\r\n  <!-- Top bar with profile and search icons -->\r\n  <div class=\"section-top-wrapper\">\r\n    {{#if searchEnabled}}\r\n    <div class=\"search-holder\">\r\n      <i class=\"fa fa-search\"></i>\r\n      <input type=\"search\" name=\"search-feed\" class=\"form-control search-feed focus-outline\" tabindex=\"0\" placeholder=\"Search...\" required >\r\n      <div class=\"btn btn-default search-btn\">Search</div>\r\n      <div class=\"btn btn-default search-btn searching-btn\"><i class=\"fa fa-spinner fa-pulse fa-fw\"></i></div>\r\n    </div>\r\n    {{/if}}\r\n    {{#if searchIconsEnabled}}\r\n    <div class=\"list-search-icon\">\r\n      {{#if bookmarksEnabled}}\r\n      <div class=\"toggle-bookmarks focus-outline\" tabindex=\"0\" data-mixitup-control=\"{{id}}\" data-toggle=\".bookmarked\" >\r\n        <span class=\"fa fa-bookmark-o\"></span>\r\n        <span class=\"fa fa-bookmark\"></span>\r\n      </div>\r\n      {{/if}}\r\n      <div class=\"list-search-cancel focus-outline\" tabindex=\"0\">\r\n        <span class=\"fa fa-times\"></span>\r\n      </div>\r\n      {{#if filtersEnabled}}\r\n      <i class=\"fa fa-sliders focus-outline\" tabindex=\"0\"></i>\r\n      {{/if}}\r\n      {{#if sortEnabled}}\r\n      <div class=\"sort-group btn-group\">\r\n        <i class=\"fa fa-sort-amount-desc focus-outline\" tabindex=\"0\" data-toggle=\"dropdown\" aria-haspopup=\"true\" aria-expanded=\"false\" aria-hidden=\"true\"></i>\r\n        <ul class=\"dropdown-menu list-sort\">\r\n          {{#each sortFields}}\r\n            <li data-sort-order=\"none\" data-sort-field=\"{{ this }}\"><span>{{ this }} {{#if this}}<i class=\"fa fa-sort focus-outline\" tabindex=\"0\" aria-hidden=\"true\"></i>{{/if}}</span></li>\r\n          {{/each}}\r\n        </ul>\r\n      </div>\r\n      {{/if}}\r\n    </div>\r\n    {{/if}}\r\n  </div>\r\n  <!-- End of Top bar -->\r\n\r\n  <!-- Inline Search and Filters -->\r\n  {{#if searchEnabled}}\r\n  <div class=\"hidden-search-controls\">\r\n    <div class=\"hidden-search-controls-content\">\r\n      <div class=\"hidden-filter-controls-search\">\r\n        <div class=\"search-query-holder\">\r\n          <div class=\"search-query\">\r\n          Searching for <span class=\"current-query-wrapper\"><span class=\"current-query\"></span><span class=\"clear-search focus-outline\" tabindex=\"0\"><i class=\"fa fa-times\"></i></span></span>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  {{/if}}\r\n  <div class=\"active-filters hidden\">\r\n    <div class=\"hidden-filter-controls-label\">Filters applied</div>\r\n    <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\r\n      <div class=\"hidden-filter-controls-filter-wrapper\">\r\n        <fieldset data-filter-active-group>\r\n        </fieldset>\r\n      </div>\r\n    </div>\r\n  </div>\r\n  {{#if filtersEnabled}}\r\n  <div class=\"hidden-filter-controls\">\r\n    <div class=\"hidden-filter-controls-content\">\r\n      {{#unless filtersInOverlay}}\r\n      {{#if filtersEnabled}}\r\n      <div class=\"filter-holder inline-filter-holder\">\r\n        <!-- Filters here -->\r\n      </div>\r\n      {{/if}}\r\n      {{/unless}}\r\n    </div>\r\n  </div>\r\n  {{/if}}\r\n  <!-- End of Inline Search and Filters -->\r\n\r\n  <div class=\"news-feed-list-wrapper\" id=\"news-feed-list-wrapper-{{id}}\" role=\"list\">\r\n    <!-- List items will appear here -->\r\n  </div>\r\n\r\n  {{#if enabledLimitEntries}}\r\n  <div class=\"limit-entries-text\">\r\n    {{#ifCond limitEntries '==' 0}}\r\n      {{#ifCond searchEnabled '||' filtersEnabled}}\r\n      <p>{{#if searchEnabled}}Search{{/if}}{{#ifCond searchEnabled '&&' filtersEnabled}} and/or {{/ifCond}}{{#if filtersEnabled}}Filter{{/if}} to see the list items</p>\r\n      {{/ifCond}}\r\n    {{/ifCond}}\r\n    {{#ifCond limitEntries '>' 0}}\r\n    <p>Showing the first {{limitEntries}} list items.{{#ifCond searchEnabled '||' filtersEnabled}} {{#if searchEnabled}}Search{{/if}}{{#ifCond searchEnabled '&&' filtersEnabled}} and/or {{/ifCond}}{{#if filtersEnabled}}Filter{{/if}} to see more.{{/ifCond}}</p>\r\n    {{/ifCond}}\r\n  </div>\r\n  {{/if}}\r\n\r\n  <div class=\"loading-holder\">\r\n    <i class=\"fa fa-circle-o-notch fa-spin\"></i> Loading...\r\n  </div>\r\n  <div class=\"no-results-holder\">\r\n    No matches found\r\n  </div>\r\n  <div class=\"no-bookmarks-holder\">\r\n    Nothing bookmarked\r\n  </div>\r\n</div>\r\n\r\n<!-- Detail view overlay -->\r\n<div class=\"news-feed-detail-overlay\" id=\"news-feed-detail-overlay-{{id}}\">\r\n  <div class=\"news-feed-detail-overlay-wrapper\">\r\n    <div class=\"news-feed-detail-overlay-panel\">\r\n      <div class=\"news-feed-detail-overlay-close {{#if previousScreen}}go-previous-screen{{/if}} focus-outline\" tabindex=\"0\">\r\n        <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\r\n      </div>\r\n      <div class=\"news-feed-detail-overlay-content\">\r\n        <div class=\"news-feed-detail-overlay-content-holder\">\r\n          <!-- Details will be added here -->\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <div class=\"news-feed-detail-overlay-close tablet {{#if previousScreen}}go-previous-screen{{/if}} focus-outline\" tabindex=\"0\">\r\n      <img src=\"{{closeIcon.black.url}}\" alt=\"close icon\" class=\"close-icon\">\r\n    </div>\r\n  </div>\r\n  <div class=\"news-feed-detail-overlay-screen {{#if previousScreen}}go-previous-screen{{/if}}\"></div>\r\n</div>\r\n\r\n{{#if showAddEntry}}\r\n<div class=\"dynamic-list-add-item focus-outline\" tabindex=\"1\">\r\n  <i class=\"fa fa-plus\"></i>\r\n</div>\r\n{{/if}}\r\n\r\n<div class=\"new-news-feed-comment-panel\">\r\n  <div class=\"news-feed-comment-panel-header\">\r\n    <div class=\"news-feed-comment-panel-title\">Comments</div>\r\n    <div class=\"news-feed-comment-close-panel focus-outline\" tabindex=\"0\"><i class=\"fa fa-times\"></i></div>\r\n  </div>\r\n\r\n  <div class=\"comments-offline\">You are offline</div>\r\n\r\n  <div class=\"news-feed-comment-area\">\r\n    <!-- Comments will be added here -->\r\n    <div class=\"loading-holder\">\r\n      <i class=\"fa fa-circle-o-notch fa-spin\"></i> Loading...\r\n    </div>\r\n  </div>\r\n\r\n  <div class=\"news-feed-comment-input-holder\">\r\n    <div class=\"input-first-row\">\r\n      <textarea class=\"form-control\" rows=\"1\" placeholder=\"Type comment\" data-comment-body></textarea>\r\n    </div>\r\n    <div class=\"input-second-row\">\r\n      <div class=\"btn btn-primary comment focus-outline\" tabindex=\"0\">Comment</div>\r\n      <div class=\"btn btn-link cancel\">Cancel</div>\r\n      <div class=\"btn btn-primary save\">Save</div>\r\n    </div>\r\n  </div>\r\n</div>\r\n";
