this["Fliplet"]["Widget"]["Templates"]["templates.build.simple-list-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"simple-list-details-holder\" data-entry-id=\"{{id}}\">\r\n  {{#each entryDetails}}\r\n    <!-- Image template -->\r\n    {{#ifCond type '==' 'image'}}\r\n      {{#if content}}\r\n        <div data-detail-entry-id=\"{{id}}\">\r\n          {{#if labelEnabled}}\r\n            <div class=\"simple-list-detail-label\">{{label}}</div>\r\n          {{/if}}\r\n          {{#if (isSingle contentArray)}}\r\n            <div class=\"simple-list-detail-body-text single-image-holder\">\r\n              <img src=\"{{validateImage content}}\">\r\n            </div>\r\n          {{else}}\r\n            <div class=\"multiple-images-holder\" >\r\n              {{#each contentArray}}\r\n                <div class=\"multiple-images-item\">\r\n                  <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\r\n                </div>\r\n              {{/each}}\r\n            </div>\r\n          {{/if}}\r\n        </div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- Plain text template -->\r\n    {{#ifCond type '==' 'text'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">{{content}}</div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- HTML template -->\r\n    {{#ifCond type '==' 'html'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">{{{auth content}}}</div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- URL template -->\r\n    {{#ifCond type '==' 'url'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">\r\n          <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\r\n        </div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- Telephone template -->\r\n    {{#ifCond type '==' 'tel'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">\r\n          <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\r\n        </div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- Email template -->\r\n    {{#ifCond type '==' 'mail'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">\r\n          <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\r\n        </div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- Date template -->\r\n    {{#ifCond type '==' 'date'}}\r\n      {{#if content}}\r\n        {{#if labelEnabled}}\r\n        <div class=\"simple-list-detail-label\">{{label}}</div>\r\n        {{/if}}\r\n\r\n        <div class=\"simple-list-detail-value\">{{formatDate content}}</div>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n    <!-- File template -->\r\n    {{#ifCond type '==' 'file'}}\r\n      {{#if content}}\r\n        <ul class=\"file-holder\">\r\n          {{#if labelEnabled}}\r\n            <div class=\"simple-list-detail-label\">{{label}}</div>\r\n          {{/if}}\r\n          {{#each content}}\r\n            <li class=\"file-item\">\r\n              <div class=\"file-title\">{{this.name}}</div>\r\n              <div class=\"file-info\">\r\n                <span class=\"file-info-uploaded\">Uploaded: {{formatDate this.uploaded}}</span>\r\n                {{#if this.size}}<span class=\"file-info-size\">&ndash; {{humanFileSize this.size}}</span>{{/if}}\r\n              </div>\r\n              <input type=\"hidden\" value={{this.url}}>\r\n              <div class=\"file-icon\">\r\n                <i class=\"fa fa-angle-right\"></i>\r\n              </div>\r\n            </li>\r\n          {{/each}}\r\n        </ul>\r\n      {{/if}}\r\n    {{/ifCond}}\r\n\r\n  {{/each}}\r\n\r\n  <!-- Edit and Delete buttons -->\r\n  <div class=\"simple-list-overlay-inner-holder {{#ifCond editEntry '||' deleteEntry}}has-edit-controls{{/ifCond}}\">\r\n    {{#ifCond editEntry '||' deleteEntry}}\r\n    <div class=\"dynamic-list-controls\">\r\n      {{#if editEntry}}\r\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">Edit</div>\r\n      {{/if}}\r\n      {{#if deleteEntry}}\r\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">Delete</div>\r\n      {{/if}}\r\n    </div>\r\n    {{/ifCond}}\r\n    <div class=\"simple-list-overlay-social-holder\">\r\n      {{#if likesEnabled}}\r\n      <div class=\"simple-list-like-holder simple-list-like-holder-{{id}}\">\r\n        <div class=\"simple-list-like-wrapper btn-like focus-outline\" tabindex=\"0\">\r\n          <span class=\"count\"></span><i class=\"fa fa-heart-o fa-lg\"></i>\r\n        </div>\r\n        <div class=\"simple-list-like-wrapper btn-liked focus-outline\" tabindex=\"0\">\r\n          <span class=\"count\"></span><i class=\"fa fa-heart fa-lg animated bounceIn\"></i>\r\n        </div>\r\n      </div>\r\n      {{/if}}\r\n\r\n      {{#if bookmarksEnabled}}\r\n      <div class=\"simple-list-bookmark-holder simple-list-bookmark-holder-{{id}}\">\r\n        <div class=\"simple-list-bookmark-wrapper btn-bookmark focus-outline\" tabindex=\"0\">\r\n          <i class=\"fa fa-bookmark-o fa-lg\"></i>\r\n        </div>\r\n        <div class=\"simple-list-bookmark-wrapper btn-bookmarked focus-outline\" tabindex=\"0\">\r\n          <i class=\"fa fa-bookmark fa-lg animated fadeIn\"></i>\r\n        </div>\r\n      </div>\r\n      {{/if}}\r\n\r\n      {{#if commentsEnabled}}\r\n      <div class=\"simple-list-comment-holder simple-list-comemnt-holder-{{id}} focus-outline\" tabindex=\"0\">\r\n        <!-- Like button will be here -->\r\n        <!-- Like placeholder -->\r\n        <i class=\"fa fa-comment-o fa-lg comment-placeholder\"></i>\r\n      </div>\r\n      {{/if}}\r\n    </div>\r\n  </div>\r\n</div>";
},"useData":true});

this["Fliplet"]["Widget"]["Templates"]["templates.build.simple-list-filters"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "{{#if filtersInOverlay}}\r\n  <div class=\"panel-group\">\r\n    {{#each filters}}\r\n      <div class=\"panel panel-default simple-list-filters-panel focus-outline\" tabindex=\"0\">\r\n        <div class=\"panel-heading\" data-toggle=\"collapse\" data-target=\"#collapse-{{id}}-{{@index}}\">\r\n          <h4 class=\"panel-title\">\r\n            <span class=\"panel-title-text\">\r\n              {{[name]}}\r\n            </span>\r\n            <span class=\"active-filter-count\"></span>\r\n            <span class=\"fa fa-angle-down\"></span>\r\n          </h4>\r\n        </div>\r\n        <div id=\"collapse-{{id}}-{{@index}}\" class=\"panel-collapse collapse\">\r\n          <div class=\"panel-body\">\r\n          {{#ifCond type '===' 'date'}}\r\n            <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n              <div class=\"filter-range-block\">\r\n                <div class=\"form-group fl-date-picker hidden-filter-controls-filter filter-date-from focus-outline\" data-type=\"{{type}}\" data-field=\"{{name}}\" data-default=\"{{min}}\">\r\n                  <i class=\"fa fa-calendar fa-fw\"></i>\r\n                  <input type=\"date\" class=\"form-control\" value=\"{{min}}\">\r\n                  <input type=\"text\" class=\"form-control\">\r\n                  <i class=\"fa fa-times fa-fw\"></i>\r\n                </div>\r\n                to\r\n              </div>\r\n              <div class=\"filter-range-block\">\r\n                <div class=\"form-group fl-date-picker hidden-filter-controls-filter filter-date-to focus-outline\" data-type=\"{{type}}\" data-field=\"{{name}}\" data-default=\"{{max}}\">\r\n                  <i class=\"fa fa-calendar fa-fw\"></i>\r\n                  <input type=\"date\" class=\"form-control\" value=\"{{max}}\">\r\n                  <input type=\"text\" class=\"form-control\">\r\n                  <i class=\"fa fa-times fa-fw\"></i>\r\n                </div>\r\n                <span class=\"btn btn-link filter-range-reset\" data-field=\"{{name}}\" tabindex=\"0\">Reset</span>\r\n              </div>\r\n            </fieldset>\r\n          {{/ifCond}}\r\n          {{#ifCond type '===' 'toggle'}}\r\n            <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n              {{#each [data]}}\r\n              <div class=\"btn hidden-filter-controls-filter focus-outline\" tabindex=\"0\" data-type=\"{{../type}}\" data-toggle=\"{{[class]}}\" data-field=\"{{../name}}\" data-value=\"{{[name]}}\" >{{[name]}}</div>\r\n              {{/each}}\r\n            </fieldset>\r\n          {{/ifCond}}\r\n          {{#unless type}}\r\n            <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n              {{#each [data]}}\r\n              <div class=\"btn hidden-filter-controls-filter focus-outline\" tabindex=\"0\" data-type=\"toggle\" data-toggle=\"{{[class]}}\" data-field=\"{{../name}}\" data-value=\"{{[name]}}\" >{{[name]}}</div>\r\n              {{/each}}\r\n            </fieldset>\r\n          {{/unless}}\r\n          </div>\r\n        </div>\r\n      </div>\r\n    {{/each}}\r\n  </div>\r\n{{else}}\r\n  {{#each filters}}\r\n    <div class=\"hidden-filter-controls-label\">Filter by <span>{{[name]}}</span></div>\r\n    <div class=\"hidden-filter-controls-filter-container hidden\" touch-action=\"pan-x pan-y\">\r\n      <div class=\"hidden-filter-controls-filter-wrapper\" data-type=\"{{type}}\">\r\n        {{#ifCond type '===' 'date'}}\r\n          <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n            <div class=\"filter-range-block\">\r\n              <div class=\"form-group fl-date-picker hidden-filter-controls-filter filter-date-from focus-outline\" data-type=\"{{type}}\" data-field=\"{{name}}\" data-default=\"{{min}}\">\r\n                <i class=\"fa fa-calendar fa-fw\"></i>\r\n                <input type=\"date\" class=\"form-control\" value=\"{{min}}\">\r\n                <input type=\"text\" class=\"form-control\">\r\n                <i class=\"fa fa-times fa-fw\"></i>\r\n              </div>\r\n              to\r\n            </div>\r\n            <div class=\"filter-range-block\">\r\n              <div class=\"form-group fl-date-picker hidden-filter-controls-filter filter-date-to focus-outline\" data-type=\"{{type}}\" data-field=\"{{name}}\" data-default=\"{{max}}\">\r\n                <i class=\"fa fa-calendar fa-fw\"></i>\r\n                <input type=\"date\" class=\"form-control\" value=\"{{max}}\">\r\n                <input type=\"text\" class=\"form-control\">\r\n                <i class=\"fa fa-times fa-fw\"></i>\r\n              </div>\r\n              <span class=\"btn btn-link filter-range-reset\" data-field=\"{{name}}\" tabindex=\"0\">Reset</span>\r\n            </div>\r\n          </fieldset>\r\n        {{/ifCond}}\r\n        {{#ifCond type '===' 'toggle'}}\r\n          <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n            {{#each [data]}}\r\n            <div class=\"btn hidden-filter-controls-filter focus-outline\" tabindex=\"0\" data-type=\"{{../type}}\" data-toggle=\"{{[class]}}\" data-field=\"{{../name}}\" data-value=\"{{[name]}}\" >{{[name]}}</div>\r\n            {{/each}}\r\n          </fieldset>\r\n        {{/ifCond}}\r\n        {{#unless type}}\r\n          <fieldset data-filter-group data-type=\"{{type}}\" data-field=\"{{name}}\">\r\n            {{#each [data]}}\r\n            <div class=\"btn hidden-filter-controls-filter focus-outline\" tabindex=\"0\" data-type=\"toggle\" data-toggle=\"{{[class]}}\" data-field=\"{{../name}}\" data-value=\"{{[name]}}\" >{{[name]}}</div>\r\n            {{/each}}\r\n          </fieldset>\r\n        {{/unless}}\r\n      </div>\r\n    </div>\r\n  {{/each}}\r\n{{/if}}\r\n";
},"useData":true});

