this["Fliplet"]["Widget"]["Templates"]["templates.build.small-h-card-detail"] = Handlebars.template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "{{#if [Image]}}\r\n<div class=\"small-h-card-list-detail-image-wrapper\">\r\n  <div class=\"small-h-card-list-detail-image\" style=\"background-image: url('{{auth [Image]}}')\"></div>\r\n  {{#unless [Image]}}<i class=\"fa fa-user\"></i>{{/unless}}\r\n</div>\r\n{{/if}}\r\n<div class=\"small-h-card-list-detail-content-scroll-wrapper\" data-entry-id=\"{{id}}\">\r\n  <div class=\"small-h-card-list-detail-content-wrapper\">\r\n    <div class=\"small-h-card-list-detail-name\">{{[First Name]}} {{[Last Name]}}</div>\r\n    <div class=\"small-h-card-list-detail-role\">{{[Title]}}</div>\r\n    <div class=\"small-h-card-list-detail-location\">{{[Location]}}</div>\r\n    <div class=\"small-h-card-list-detail-buttons-wrapper\">\r\n      {{#if [Email]}}\r\n      <div class=\"small-h-card-list-detail-button\">\r\n        <a href=\"mailto:{{[Email]}}\" target=\"_blank\" class=\"focus-outline\">\r\n          <div class=\"small-h-card-list-detail-button-image\"><span class=\"fa fa-envelope-o\"></span></div>\r\n          <div class=\"small-h-card-list-detail-button-text\">EMAIL</div>\r\n        </a>\r\n      </div>\r\n      {{/if}}\r\n      {{#if [Telephone]}}\r\n      <div class=\"small-h-card-list-detail-button\">\r\n        <a href=\"tel:{{[Telephone]}}\" target=\"_blank\" class=\"focus-outline\">\r\n          <div class=\"small-h-card-list-detail-button-image\"><span class=\"fa fa-phone\"></span></div>\r\n          <div class=\"small-h-card-list-detail-button-text\">CALL</div>\r\n        </a>\r\n      </div>\r\n      {{/if}}\r\n      {{#if [Linkedin]}}\r\n      <div class=\"small-h-card-list-detail-button\">\r\n        <a href=\"{{[Linkedin]}}\" target=\"_blank\" class=\"focus-outline\">\r\n          <div class=\"small-h-card-list-detail-button-image\"><span class=\"fa fa-linkedin\"></span></div>\r\n          <div class=\"small-h-card-list-detail-button-text\">LINKEDIN</div>\r\n        </a>\r\n      </div>\r\n      {{/if}}\r\n    </div>\r\n\r\n    <div class=\"small-h-card-details-holder\">\r\n      {{#each entryDetails}}\r\n        <!-- Image template -->\r\n        {{#ifCond type '==' 'image'}}\r\n          {{#if content}}\r\n            <div data-detail-entry-id=\"{{id}}\">\r\n              {{#if labelEnabled}}\r\n                <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n              {{/if}}\r\n              {{#if (isSingle contentArray)}}\r\n                <div class=\"small-h-card-list-detail-body-text single-image-holder\">\r\n                  <img src=\"{{validateImage content}}\">\r\n                </div>\r\n              {{else}}\r\n                <div class=\"multiple-images-holder\" >\r\n                  {{#each contentArray}}\r\n                    <div class=\"multiple-images-item\">\r\n                      <div class=\"image\" style=\"background-image: url('{{validateImage this}}')\"></div>\r\n                    </div>\r\n                  {{/each}}\r\n                </div>\r\n              {{/if}}\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Plain text template -->\r\n        {{#ifCond type '==' 'text'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">{{content}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- HTML template -->\r\n        {{#ifCond type '==' 'html'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">{{{auth content}}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- URL template -->\r\n        {{#ifCond type '==' 'url'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">\r\n              <a href=\"{{{auth content}}}\" target=\"_blank\">Tap to open</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Telephone template -->\r\n        {{#ifCond type '==' 'tel'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">\r\n              <a href=\"tel:{{removeSpaces content}}\" target=\"_blank\">{{content}}</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Email template -->\r\n        {{#ifCond type '==' 'mail'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">\r\n              <a href=\"mailto:{{content}}\" target=\"_blank\">{{content}}</a>\r\n            </div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- Date template -->\r\n        {{#ifCond type '==' 'date'}}\r\n          {{#if content}}\r\n            {{#if labelEnabled}}\r\n            <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n            {{/if}}\r\n\r\n            <div class=\"small-h-card-list-detail-body-text\">{{formatDate content}}</div>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n        <!-- File template -->\r\n        {{#ifCond type '==' 'file'}}\r\n          {{#if content}}\r\n            <ul class=\"file-holder\">\r\n              {{#if labelEnabled}}\r\n                <div class=\"small-h-card-list-detail-label\">{{label}}</div>\r\n              {{/if}}\r\n              {{#each content}}\r\n                <li class=\"file-item\">\r\n                  <div class=\"file-title\">{{this.name}}</div>\r\n                  <div class=\"file-info\">\r\n                    <span class=\"file-info-uploaded\">Uploaded: {{formatDate this.uploaded}}</span>\r\n                    {{#if this.size}}<span class=\"file-info-size\">&ndash; {{humanFileSize this.size}}</span>{{/if}}\r\n                  </div>\r\n                  <input type=\"hidden\" value={{this.url}}>\r\n                  <div class=\"file-icon\">\r\n                    <i class=\"fa fa-angle-right\"></i>\r\n                  </div>\r\n                </li>\r\n              {{/each}}\r\n            </ul>\r\n          {{/if}}\r\n        {{/ifCond}}\r\n\r\n      {{/each}}\r\n    </div>\r\n\r\n    <!-- Edit or Delete buttons -->\r\n    {{#ifCond editEntry '||' deleteEntry}}\r\n    <div class=\"dynamic-list-controls\">\r\n      {{#if editEntry}}\r\n      <div class=\"btn btn-default dynamic-list-edit-item focus-outline\" tabindex=\"0\">Edit</div>\r\n      {{/if}}\r\n      {{#if deleteEntry}}\r\n      <div class=\"btn btn-danger dynamic-list-delete-item focus-outline\" tabindex=\"0\">Delete</div>\r\n      {{/if}}\r\n    </div>\r\n    {{/ifCond}}\r\n  </div>\r\n</div>\r\n";
},"useData":true});

